import React from 'react';
import Homepage from './Homepage';

const AnimatedSwitch = withRouter(({ location }) => (
  <TransitionGroup>
    <CSSTransition
      key={location.key}
      classNames="slide"
      timeout={1000}
    >
      <Switch>
        <Route path='/first' component={Homepage} />
        <Route path='/second' component={Second} />
      </Switch>
    </CSSTransition>
  </TransitionGroup>
));

export default AnimatedSwitch;
